// 最近読んだ本の情報
// openBD APIは終了しているため、手動で書籍情報を入力してください
export interface RecentBook {
  isbn: string;
  title: string;
  author: string;
  publisher?: string;
  pubdate?: string;
  cover?: string; // 表紙画像のURL
  summary?: string; // 内容紹介
}

export const recentBooks: RecentBook[] = [
  {
    isbn: "9781250105790",
    title: "書籍タイトルを入力してください",
    author: "著者名を入力してください",
    publisher: "出版社名（任意）",
    pubdate: "発行日（任意）",
    cover: "https://via.placeholder.com/300x400?text=Book+Cover", // 表紙画像のURLを入力
    summary: "内容紹介（任意）",
  },
];
